import styled from "styled-components";

const AppTableHeaderCol = styled.div<{ width?: string }>`
 
  display: flex;
    flex-flow: row nowrap;
    display: flex;
    flex-flow: row nowrap;
    padding: 10px;
    justify-content: space-around;
    width: 100%;
    justify-content: space-around;
    width: 100%;
`;

export default AppTableHeaderCol;
